import React from 'react';

const Nav = () => {
    return (
        <div>
            <ul>
                <li>Home</li>
                <li>Gallery</li>
                <li>Store</li>
                <li>Contact Us</li>
            </ul>
        </div>
    );
}

export default Nav;
